  padding: 0;
`

const Nav = styled.div`
    width: 300px;
    height: 100%;
    background-color: #d5e8ff;
`

class List extends Component {
    state = {  }
    render() { 
        return (
            <Container>
                <Nav />
            </Container>
        );
    }
}
 
export default List;
